B.a09=new A.U(B.aH,["tr","Blog T\xfcrk\xe7e dilinde","Blog T\xfcrk\xe7e dilinde","\xc7eviriliyor...","Ba\u015fl\u0131k Ara","Fatih Koparan'\u0131n Galaksi Rehberi","Hakk\u0131nda","Harita","Blog","Ba\u011f\u0131\u015f Yap","Dar\xfc\u015f\u015fafaka Cemiyeti, babalar\u0131n\u0131 kaybetmi\u015f ihtiya\xe7 sahibi yetenekli \xe7ocuklara e\u011fitimde e\u015fit f\u0131rsat sa\u011flamak amac\u0131yla 1863 y\u0131l\u0131nda kurulmu\u015ftur. O tarihten beri \u201cE\u011fitimde E\u015fit F\u0131rsat\u201d misyonuyla varl\u0131\u011f\u0131n\u0131 s\xfcrd\xfcrmektedir. Okulu finanse etmek amac\u0131yla ba\u011f\u0131\u015flarla kaynak toplayan 158 y\u0131ll\u0131k Cemiyetimiz, 14 Nisan 2012 tarihinde t\xfcz\xfc\u011f\xfcn\xfc de\u011fi\u015ftirerek Dar\xfc\u015f\u015fafaka Okullar\u0131n\u0131n kap\u0131lar\u0131n\u0131 annelerini kaybetmi\u015f \xf6\u011frenciler i\xe7in de a\xe7m\u0131\u015ft\u0131r. Bug\xfcn Dar\xfc\u015f\u015fafaka, bir veya her iki ebeveynini kaybetmi\u015f ihtiya\xe7 sahibi yetenekli \xf6\u011frenciler i\xe7in daha iyi bir gelecek yaratmaktad\u0131r. On ya\u015f\u0131ndaki \xf6\u011frencileri davet eden Cemiyetimiz, \xf6\u011frencinin be\u015finci s\u0131n\u0131f\u0131ndan lise sonuna kadar tam burs ve yat\u0131l\u0131 e\u011fitim imkan\u0131 sa\u011flamaktad\u0131r. D\xfcnya standartlar\u0131nda bir e\u011fitim f\u0131rsat\u0131 sunulan \xf6\u011frenciler, topluma kar\u015f\u0131 sorumluluk duyan, kendine g\xfcvenen, d\xfc\u015f\xfcnen, sorgulayan ve merakl\u0131 bireyler olarak yeni bir hayata ad\u0131m atmaktad\u0131rlar.","Herkese selamlar.\n\nGloballe\u015fen d\xfcnyada art\u0131k her \u015fey ayn\u0131la\u015fmaya ba\u015flad\u0131. El Salvador'dan Japonya'ya, \xdcrd\xfcn'den Cape Town'a ayn\u0131 markalar, ayn\u0131 evler, ayn\u0131 hikayeler, ayn\u0131 d\xfc\u015f\xfcnen insanlar etraf\u0131m\u0131z\u0131 sard\u0131. Bu kanalda ayn\u0131la\u015fan d\xfcnyam\u0131z\u0131n k\u0131y\u0131s\u0131nda k\xf6\u015fesinde kalm\u0131\u015f farkl\u0131l\u0131klar\u0131, yerel lezzetleri, sokak yemeklerini, \xfclkelerin tarihini, uzaklardaki kabileleri, \xfclkelerin ayd\u0131nl\u0131k taraflar\u0131 kadar karanl\u0131k taraflar\u0131n\u0131 ke\u015ffetmeye \xe7al\u0131\u015f\u0131yorum. T\xfcm kanal\u0131m\u0131z\u0131n gelirlerini de sayenizde \xf6\u011frencilere burs veriyorum. Dekontlar\u0131 da payla\u015f\u0131yorum. Bu kanal hepimizin. O sebeple takip edip destek olursan\u0131z sevinirim.\n\nSevgiler."],t.w)
B.a0d=new A.U(B.aH,["en","Auto Translate All Entries to The English","Show Original Language","Translating...","Search Title","Fatih Koparan's Guide to the Galaxy","About","Map","Blog","Donate","Dar\xfc\u015f\u015fafaka Society was founded in 1863 with the aim of providing  equal opportunity in education to needy, talented children who had lost their fathers. Since then, it has maintained its presence with this mission of 'Equal Opportunity in Education'. Our 158-year old Society, whose role is to raise funds via donations to finance the school, amended its statutes on 14 April 2012 and opened the doors of Dar\xfc\u015f\u015fafaka Schools to also include students who have lost their mothers. Today, Dar\xfc\u015f\u015fafaka creates a better future for needy, talented students with one or no parents. Inviting students at the age of ten, the Society provides full scholarship and boarding from a student\u2019s fifth year through to the end of high school. Given an opportunity for a world-class education, students are able to embark on a new life as self confident, thinking, inquiring, and curious individuals who feel responsible for the community.","Hello everyone.\n\nIn our globalizing world, everything is starting to become the same. From El Salvador to Japan, from Jordan to Cape Town, the same brands, the same houses, the same stories, and the same thinking people surround us. On this channel, I try to explore the differences, local flavors, street foods, the history of countries, distant tribes, and both the bright and dark sides of countries that remain on the edges and corners of our homogenizing world. Thanks to you, I give all the channel\u2019s income as scholarships to students. I also share the receipts. This channel belongs to all of us. So I would be happy if you follow and support it.\n\nRegards."],t.w)
B.a0f=new A.U(B.aH,["es","Traducir autom\xe1ticamente todas las entradas al espa\xf1ol","Mostrar idioma original","Traduciendo...","Buscar t\xedtulo","La Gu\xeda de la Galaxia de Fatih Koparan","Acerca de","Mapa","Blog","Donar","La Sociedad Dar\xfc\u015f\u015fafaka fue fundada en 1863 con el objetivo de proporcionar igualdad de oportunidades educativas a ni\xf1os necesitados y talentosos que hab\xedan perdido a sus padres. Desde entonces, ha mantenido su presencia con esta misi\xf3n de \u201cIgualdad de Oportunidades en la Educaci\xf3n\u201d. Nuestra Sociedad de 158 a\xf1os, cuyo papel es recaudar fondos mediante donaciones para financiar la escuela, modific\xf3 sus estatutos el 14 de abril de 2012 y abri\xf3 las puertas de las escuelas Dar\xfc\u015f\u015fafaka para incluir tambi\xe9n a estudiantes que han perdido a sus madres. Hoy en d\xeda, Dar\xfc\u015f\u015fafaka crea un futuro mejor para estudiantes necesitados y talentosos con uno o ning\xfan padre. Invitando a estudiantes a la edad de diez a\xf1os, la Sociedad proporciona becas completas y residencia desde el quinto a\xf1o de estudiante hasta el final de la escuela secundaria. Con la oportunidad de una educaci\xf3n de clase mundial, los estudiantes pueden embarcarse en una nueva vida como individuos seguros de s\xed mismos, pensadores, inquisitivos y curiosos que sienten responsabilidad por la comunidad.","Hola a todos.\n\nEn nuestro mundo globalizado, todo est\xe1 empezando a ser igual. Desde El Salvador hasta Jap\xf3n, desde Jordania hasta Ciudad del Cabo, las mismas marcas, las mismas casas, las mismas historias y las mismas personas pensantes nos rodean. En este canal, trato de explorar las diferencias, los sabores locales, la comida callejera, la historia de los pa\xedses, las tribus lejanas y tanto los lados brillantes como oscuros de los pa\xedses que permanecen en los bordes y rincones de nuestro mundo homogeneizado. Gracias a ustedes, doy todos los ingresos del canal como becas a estudiantes. Tambi\xe9n comparto los recibos. Este canal es de todos nosotros. As\xed que me alegrar\xeda que lo sigan y apoyen.\n\nSaludos."],t.w)
B.a0j=new A.U(B.aH,["fr","Traduire automatiquement toutes les entr\xe9es en fran\xe7ais","Afficher la langue originale","Traduction en cours...","Rechercher un titre","Le Guide de la Galaxie de Fatih Koparan","\xc0 propos","Carte","Blog","Faire un don","La Soci\xe9t\xe9 Dar\xfc\u015f\u015fafaka a \xe9t\xe9 fond\xe9e en 1863 dans le but de fournir des chances \xe9gales en \xe9ducation aux enfants talentueux dans le besoin ayant perdu leur p\xe8re. Depuis lors, elle maintient sa pr\xe9sence avec cette mission d\u2019\xab \xe9galit\xe9 des chances en \xe9ducation \xbb. Notre Soci\xe9t\xe9 vieille de 158 ans, dont le r\xf4le est de collecter des fonds via des dons pour financer l\u2019\xe9cole, a modifi\xe9 ses statuts le 14 avril 2012 et a ouvert les portes des \xe9coles Dar\xfc\u015f\u015fafaka aux \xe9l\xe8ves ayant perdu leur m\xe8re. Aujourd\u2019hui, Dar\xfc\u015f\u015fafaka cr\xe9e un avenir meilleur pour les \xe9l\xe8ves talentueux et n\xe9cessiteux ayant un ou aucun parent. Invitant les \xe9l\xe8ves \xe0 l\u2019\xe2ge de dix ans, la Soci\xe9t\xe9 offre une bourse compl\xe8te et un internat \xe0 partir de la cinqui\xe8me ann\xe9e jusqu\u2019\xe0 la fin du lyc\xe9e. Offerts une \xe9ducation de classe mondiale, les \xe9l\xe8ves peuvent commencer une nouvelle vie en tant qu\u2019individus confiants, r\xe9fl\xe9chis, curieux et responsables envers la communaut\xe9.","Bonjour \xe0 tous.\n\nDans notre monde mondialis\xe9, tout commence \xe0 devenir pareil. D'El Salvador au Japon, de la Jordanie au Cap, les m\xeames marques, les m\xeames maisons, les m\xeames histoires et les m\xeames personnes r\xe9fl\xe9chies nous entourent. Sur cette cha\xeene, j'essaie d'explorer les diff\xe9rences, les saveurs locales, la nourriture de rue, l'histoire des pays, les tribus lointaines, ainsi que les c\xf4t\xe9s lumineux et sombres des pays qui restent aux marges de notre monde homog\xe9n\xe9is\xe9. Gr\xe2ce \xe0 vous, je donne tous les revenus de la cha\xeene en bourses aux \xe9tudiants. Je partage aussi les re\xe7us. Cette cha\xeene appartient \xe0 nous tous. Je serais donc heureux que vous la suiviez et la souteniez.\n\nCordialement."],t.w)
B.a0i=new A.U(B.aH,["de","Automatisch alle Eintr\xe4ge ins Deutsche \xfcbersetzen","Originalsprache anzeigen","\xdcbersetzen...","Titel suchen","Fatih Koparans Galaxief\xfchrer","\xdcber","Karte","Blog","Spenden","Die Dar\xfc\u015f\u015fafaka-Gesellschaft wurde 1863 gegr\xfcndet, um bed\xfcrftigen, talentierten Kindern, die ihre V\xe4ter verloren hatten, gleiche Bildungschancen zu bieten. Seitdem besteht sie mit der Mission \u201eGleiche Bildungschancen\u201c fort. Unsere 158 Jahre alte Gesellschaft, deren Aufgabe es ist, durch Spenden Mittel f\xfcr die Schule zu beschaffen, \xe4nderte am 14. April 2012 ihre Satzung und \xf6ffnete die T\xfcren der Dar\xfc\u015f\u015fafaka-Schulen auch f\xfcr Sch\xfcler, die ihre M\xfctter verloren haben. Heute schafft Dar\xfc\u015f\u015fafaka eine bessere Zukunft f\xfcr bed\xfcrftige, talentierte Sch\xfcler mit einem oder ohne Elternteil. Die Gesellschaft nimmt Sch\xfcler im Alter von zehn Jahren auf und bietet von der f\xfcnften Klasse bis zum Ende der High School ein Vollstipendium und Internatsunterbringung. Mit der Chance auf eine erstklassige Ausbildung k\xf6nnen die Sch\xfcler ein neues Leben als selbstbewusste, denkende, fragende und neugierige Individuen beginnen, die sich ihrer Verantwortung gegen\xfcber der Gemeinschaft bewusst sind.","Hallo zusammen.\n\nIn unserer globalisierten Welt beginnt alles, gleich zu werden. Von El Salvador bis Japan, von Jordanien bis Kapstadt umgeben uns dieselben Marken, dieselben H\xe4user, dieselben Geschichten und dieselben denkenden Menschen. In diesem Kanal versuche ich, die Unterschiede, lokalen Geschm\xe4cker, Stra\xdfenessen, die Geschichte der L\xe4nder, ferne St\xe4mme und sowohl die hellen als auch die dunklen Seiten der L\xe4nder zu erkunden, die am Rand unserer sich vereinheitlichenden Welt bleiben. Dank euch gebe ich alle Einnahmen des Kanals als Stipendien an Studenten weiter. Ich teile auch die Belege. Dieser Kanal geh\xf6rt uns allen. Deshalb w\xfcrde ich mich freuen, wenn ihr folgt und unterst\xfctzt.\n\nViele Gr\xfc\xdfe."],t.w)
