B.a08=new A.U(B.aH,["pl","Automatyczne t\u0142umaczenie wszystkich wpis\xf3w na j\u0119zyk polski","Poka\u017c oryginalny j\u0119zyk","T\u0142umaczenie...","Wyszukaj tytu\u0142","Galaktyczny Przewodnik Fatih Koparan","O nas","Mapa","Blog","Przeka\u017c darowizn\u0119","Towarzystwo Dar\xfc\u015f\u015fafaka zosta\u0142o za\u0142o\u017cone w 1863 roku w celu zapewnienia r\xf3wnych szans w edukacji uzdolnionym i potrzebuj\u0105cym dzieciom, kt\xf3re straci\u0142y ojc\xf3w. Od tamtej pory dzia\u0142a z misj\u0105 \u201eR\xf3wnych Szans w Edukacji\u201d. Nasze 158-letnie towarzystwo zbiera fundusze poprzez darowizny na rzecz szko\u0142y. 14 kwietnia 2012 r. zmieniono statut, aby obj\u0105\u0107 tak\u017ce uczni\xf3w, kt\xf3rzy stracili matki. Obecnie Dar\xfc\u015f\u015fafaka tworzy lepsz\u0105 przysz\u0142o\u015b\u0107 dla utalentowanych dzieci, kt\xf3re straci\u0142y jednego lub oboje rodzic\xf3w. Zaprasza uczni\xf3w od dziesi\u0105tego roku \u017cycia i przyznaje pe\u0142ne stypendium oraz internat od pi\u0105tej klasy do uko\u0144czenia szko\u0142y \u015bredniej. Otrzymuj\u0105c edukacj\u0119 na \u015bwiatowym poziomie, uczniowie zaczynaj\u0105 nowe \u017cycie jako pewni siebie, my\u015bl\u0105cy, dociekliwi i odpowiedzialni obywatele spo\u0142ecze\u0144stwa.","Cze\u015b\u0107 wszystkim.\n\nW zglobalizowanym \u015bwiecie wszystko staje si\u0119 takie samo. Od Salwadoru przez Japoni\u0119, od Jordanii po Kapsztad \u2013 te same marki, te same domy, te same historie i ci sami my\u015bl\u0105cy ludzie nas otaczaj\u0105. Na tym kanale pr\xf3buj\u0119 odkrywa\u0107 r\xf3\u017cnice, lokalne smaki, jedzenie uliczne, histori\u0119 pa\u0144stw, odleg\u0142e plemiona i zar\xf3wno jasne, jak i ciemne strony kraj\xf3w, kt\xf3re pozostaj\u0105 na obrze\u017cach tego unifikowanego \u015bwiata. Dzi\u0119ki wam ca\u0142y doch\xf3d kana\u0142u przekazuj\u0119 na stypendia dla student\xf3w. Udost\u0119pniam r\xf3wnie\u017c potwierdzenia wp\u0142at. Ten kana\u0142 nale\u017cy do nas wszystkich. B\u0119d\u0119 wdzi\u0119czny za obserwacj\u0119 i wsparcie."],t.w)
B.a0m=new A.U(B.aH,["sv","\xd6vers\xe4tt automatiskt alla poster till svenska","Visa originalspr\xe5k","\xd6vers\xe4tter...","S\xf6k titel","Fatih Koparans galaxguide","Om oss","Karta","Blogg","Donera","Dar\xfc\u015f\u015fafaka-s\xe4llskapet grundades 1863 med m\xe5let att ge j\xe4mlika utbildningsm\xf6jligheter till beg\xe5vade barn i n\xf6d som mist sina f\xe4der. Sedan dess har f\xf6reningen verkat f\xf6r missionen \u201cLika m\xf6jligheter i utbildning\u201d. V\xe5r 158\u2011\xe5riga f\xf6rening samlar in medel via donationer f\xf6r att finansiera skolan. Den 14 april 2012 \xe4ndrades stadgarna f\xf6r att ocks\xe5 omfatta elever som f\xf6rlorat sina m\xf6drar. Idag skapar Dar\xfc\u015f\u015fafaka en b\xe4ttre framtid f\xf6r beg\xe5vade barn som mist en eller b\xe5da f\xf6r\xe4ldrarna. F\xf6reningen bjuder in elever fr\xe5n tio \xe5rs \xe5lder och erbjuder full stipendium och internat fr\xe5n femte klass till gymnasieexamen. Med tillg\xe5ng till utbildning i v\xe4rldsklass kan studenter b\xf6rja ett nytt liv som sj\xe4lvs\xe4kra, eftert\xe4nksamma, nyfikna och ansvarstagande individer.","Hej allihopa.\n\nI v\xe5r globaliserade v\xe4rld b\xf6rjar allt bli likadant. Fr\xe5n El Salvador till Japan, fr\xe5n Jordanien till Kapstaden, omges vi av samma m\xe4rken, samma hus, samma ber\xe4ttelser och samma t\xe4nkande m\xe4nniskor. P\xe5 den h\xe4r kanalen f\xf6rs\xf6ker jag utforska skillnaderna, lokala smaker, street food, l\xe4ndernas historia, avl\xe4gsna stammar, liksom de ljusa och m\xf6rka sidorna av l\xe4nder som befinner sig i utkanten av v\xe5r homogena v\xe4rld. Tack vare er ger jag alla kanalens inkomster som stipendier till studenter. Jag delar ocks\xe5 kvitton. Denna kanal tillh\xf6r oss alla. Jag skulle bli glad om ni f\xf6ljer och st\xf6ttar den."],t.w)
B.a07=new A.U(B.aH,["nl","Automatisch alle vermeldingen vertalen naar het Nederlands","Originele taal tonen","Vertalen...","Zoek titel","Fatih Koparans Galaxiegids","Over","Kaart","Blog","Doneren","De Dar\xfc\u015f\u015fafaka\u2011Vereniging werd in 1863 opgericht met als doel gelijkwaardige onderwijskansen te bieden aan getalenteerde kinderen in armoede die hun vader hadden verloren. Sindsdien zet de vereniging zich in voor de missie 'Gelijke Onderwijskansen'. Onze 158\u2011jarige vereniging werft via donaties financiering voor de school. Op 14 april 2012 werd het statuut gewijzigd om ook leerlingen te accepteren die hun moeder hadden verloren. Tegenwoordig cre\xebert Dar\xfc\u015f\u015fafaka een betere toekomst voor getalenteerde kinderen die \xe9\xe9n of beide ouders hebben verloren. Vanaf hun tiende jaar nodigt de vereniging leerlingen uit en biedt volledige beurzen en internaten vanaf groep 5 tot het einde van de middelbare school. Met toegang tot onderwijs van wereldklasse kunnen studenten een nieuw leven beginnen als zelfverzekerde, denkwijzen, nieuwsgierige en maatschappelijk verantwoordelijk individuen.","Hallo allemaal.\n\nIn onze geglobaliseerde wereld wordt alles steeds hetzelfde. Van El Salvador tot Japan, van Jordani\xeb tot Kaapstad: we worden omringd door dezelfde merken, dezelfde huizen, dezelfde verhalen en dezelfde nadenkende mensen. Op dit kanaal probeer ik de verschillen, lokale smaken, streetfood, de geschiedenis van landen, verre stammen en zowel de lichte als de donkere kanten van landen te ontdekken die aan de rand van onze homogene wereld blijven. Dankzij jullie geef ik alle inkomsten van het kanaal als beurzen aan studenten. Ik deel ook de bewijsstukken. Dit kanaal is van ons allemaal. Ik zou het op prijs stellen als je volgt en ondersteunt."],t.w)
