B.a0c=new A.U(B.aH,["no","Oversett alle oppf\xf8ringer automatisk til norsk","Vis originalspr\xe5k","Oversetter...","S\xf8k etter tittel","Fatih Koparans galakseguide","Om","Kart","Blogg","Doner","Dar\xfc\u015f\u015fafaka-foreningen ble grunnlagt i 1863 med m\xe5l om \xe5 tilby like utdanningsmuligheter til talentfulle og trengende barn som har mistet faren sin. Foreningen har i 158 \xe5r jobbet med misjonen om \xablike muligheter i utdanning\xbb. Den 14. april 2012 ble vedtektene endret for ogs\xe5 \xe5 inkludere barn som har mistet moren. I dag gir Dar\xfc\u015f\u015fafaka et bedre framtidsh\xe5p til begavede barn som har mistet \xe9n eller begge foreldre. Foreningen tilbyr fullt stipend og internat for elever fra 10 \xe5rs alder (5. klasse) til de fullf\xf8rer videreg\xe5ende skole, med utdanning p\xe5 verdensniv\xe5.","Hei alle sammen\n\nI en globalisert verden begynner alt \xe5 ligne p\xe5 hverandre. Fra El Salvador til Japan, fra Jordan til Cape Town \u2013 vi er omgitt av de samme merkene, de samme husene, de samme historiene og de samme tenkende menneskene. P\xe5 denne kanalen pr\xf8ver jeg \xe5 utforske forskjellene som gjenst\xe5r: lokale smaker, gatemat, nasjoners historie, fjerne stammer og b\xe5de de lyse og m\xf8rke sidene av ulike land.\n\nTakket v\xe6re dere g\xe5r alle inntektene fra kanalen til stipend for studenter, og jeg deler kvitteringer \xe5pent. Denne kanalen tilh\xf8rer oss alle. Jeg blir glad hvis du f\xf8lger og st\xf8tter den.\n\nTusen takk"],t.w)
